import 'dart:io';
import 'package:http/http.dart' as http;
import 'dart:convert';

class SteganographyAPI {
  final String _baseUrl;

  SteganographyAPI(this._baseUrl);

  Future<Map<String, dynamic>> streamedResponseToJson(
      http.StreamedResponse response) async {
    final bytes = await response.stream.toBytes();
    final responseBody = utf8.decode(bytes);
    final jsonResponse = json.decode(responseBody);
    return jsonResponse;
  }
  // Endpoint to accept 4 images and return a steganographed image

  Future<File> encryptFile(File coverImage, List<File> secretImages) async {
    var request = http.MultipartRequest(
      'POST',
      Uri.parse('https://dbff-119-82-85-116.ngrok-free.app/encrypt'),
    );
    request.files.add(http.MultipartFile(
      'cover_image',
      coverImage.readAsBytes().asStream(),
      coverImage.lengthSync(),
      filename: coverImage.path.split('/').last,
    ));
    for (var i = 0; i < secretImages.length; i++) {
      request.files.add(http.MultipartFile(
        'secret_image${i + 1}',
        secretImages[i].readAsBytes().asStream(),
        secretImages[i].lengthSync(),
        filename: secretImages[i].path.split('/').last,
      ));
    }
    var response = await request.send();
    var json = await streamedResponseToJson(response);
    print(json);
    var bytes = base64.decode(json['hidden_image']);
    var file = File('encrypted_file.png')..writeAsBytesSync(bytes);
    return file;
  }

  Future<String> encryptImages(
    File coverImage,
    File secretImage1,
    File secretImage2,
    File secretImage3,
  ) async {
    final url = 'https://dbff-119-82-85-116.ngrok-free.app/encrypt';
    final request = http.MultipartRequest('POST', Uri.parse(url));
    request.files.addAll([
      http.MultipartFile.fromBytes(
        'cover_image',
        await coverImage.readAsBytes(),
        filename: 'cover_image.jpg',
      ),
      http.MultipartFile.fromBytes(
        'secret_image1',
        await secretImage1.readAsBytes(),
        filename: 'secret_image1.jpg',
      ),
      http.MultipartFile.fromBytes(
        'secret_image2',
        await secretImage2.readAsBytes(),
        filename: 'secret_image2.jpg',
      ),
      http.MultipartFile.fromBytes(
        'secret_image3',
        await secretImage3.readAsBytes(),
        filename: 'secret_image3.jpg',
      ),
    ]);
    final response = await request.send();
    final responseBytes = await response.stream.toBytes();
    print(responseBytes);
    final responseString = utf8.decode(responseBytes);
    print(responseString);
    final decodedBytes = base64Decode(responseString);
    return base64.encode(decodedBytes);
  }

  Future<List<File>> decryptImage(File hiddenImage) async {
    var request = http.MultipartRequest(
      'POST',
      Uri.parse('https://dbff-119-82-85-116.ngrok-free.app/decrypt'),
    );
    request.files.add(http.MultipartFile(
      'hidden_image',
      hiddenImage.readAsBytes().asStream(),
      hiddenImage.lengthSync(),
      filename: hiddenImage.path.split('/').last,
    ));
    var response = await request.send();
    var jsonMap = await streamedResponseToJson(response);
    var secretImages = <File>[];
    for (var i = 1; i <= 3; i++) {
      var base64Str = jsonMap['reveal_image$i'];
      var bytes = base64.decode(base64Str);
      var file = File('secret_image$i.png');
      await file.writeAsBytes(bytes);
      secretImages.add(file);
    }
    return secretImages;
  }
}

